write a Python function to do a case insensitive sort of a list of strings
def case_insensitive_sort(strings): 
    # create an empty dictionary with the same length as the input string
    sorted_dict = {}

    # iterate over each element in the input string and store it in the dictionary
    for i, s in enumerate(strings):
        if s not in sorted_dict:
            sorted_dict[s] = 1

    # sort the dictionary based on the values
    sorted_list = list(sorted_dict.values())

    return sorted_list
